import {Route,Switch} from 'react-router';

//Componentes
import App from './App';

const AppRoutes = () =>(

	<App>
		<Switch>
			<Route exact path="./login" component={Login}/>
			<Route exact path="/" component={Home}/>
		</Switch>
	</App>
);
